Legion of Super-Heroes v4 #33
Publisher:  DC Comics
Publication Date:  September 1992

Writers:  Tom Bierbaum and Mary Bierbaum
Pencillers:  David A. Williams and Chris Sprouse
Inker:  Karl Story
Letterer:  John Workman
Colorist:  Tom McCraw
Editor:  Michael Eury

Chameleon Boy tracks his father R.J. Brande to Yal, who has come searching for the Soul of Antares. The Dominators dispatch Hunter to kill Brande and Cham, but they are saved by Kid Quantum - the first Legionnaire to ever die in battle.

Thanks goes to DobisP.R. for this release.

